    "2016-11-25T21:06:16.188287",nt"name": "federal-family-education-loan-direct-loan-cohort-default-rates-2011",nt"isopen":
    true,nt"url": null,nt"notes": "The Federal Family Education Loan/Direct
    Loan Cohort Default Rates, 2011 (FFEL/Direct Loan CDR 2011), is a data collection
    that is part of the Federal Family Education Loan/Direct Loan Cohort Default Rate
    (FFEL/Direct Loan CDR) program; program data is available since 2009 at <https://www.nslds.ed.gov/nslds_SA/defaultmanagement/search_cohort_3yr2011CY.cfm>.
    FFEL/Direct Loan CDR 2011 (http://www.ifap.ed.gov/defaultmanagement/defaultmangement.html)
    is a cross-sectional data collection of supplementary data regarding and appeals
    by postsecondary and other eligible institutions participating in the Federal Family
    Education Loan (FFEL) and William D. Ford Federal Direct Loan (Direct Loan) programs
    to the rates of default by annual cohorts of students having attended those institutions
    and having received Federal assistance under the FFEL and Direct Loan programs against
    those same student loans, as calculated by Federal Student Aid using data derived
    from the National Student Loan Data System (NSLDS). Responding institutions use
    a web-based entry system to provide supplementary information and appeal the default
    rate calculation. Key statistics produced from this study are the cohort default
    rates (CDRs).",nt"license_title": "Creative Commons CCZero",nt"extras":
